import React from "react";
import Container from "@mui/material/Container";
import Input from "@mui/joy/Input";
import Grid from "@mui/joy/Grid";

export default function Login() {
  return (
    <Container
      maxWidth="sm"
      style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        height: "100vh",
      }}
    >
      <Container
        maxWidth="sm"
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          height: "40vh",
          width: "40vh",
          backgroundColor: "red",
        }}
      >
        <Grid
          container
          direction="column"
          justifyContent="center"
          alignItems="center"
          spacing={3}
          sx={{ flexGrow: 1 }}
        >
          <Grid xs={12} >
            Login
          </Grid>
          <Grid xs={12} md={12}>
            <Input placeholder="Type your Username" variant="soft" />
          </Grid>
          <Grid xs={12} md={12}>
            <Input placeholder="Type your Password" variant="soft" />
          </Grid>
          <Grid xs={12} md={12}>
            xs=6 md=8
          </Grid>
        </Grid>
      </Container>
    </Container>
  );
}
